import { Routes, Route } from "react-router-dom";
import LogIn from './Pages/LogIn/LogIn';
import AllMedics from './Pages/beforeLogIn/Medics/AllMedics';
import AllServices from './Pages/beforeLogIn/Services/AllServices';
import OpeningHours from './Pages/beforeLogIn/OpeningHours/OpeningHours';
import Home from './Pages/beforeLogIn/Home/Home';
import Contact from './Pages/beforeLogIn/Contact/Contact';
import LayoutBeforeLogIn from './Pages/beforeLogIn/Layout_Before_LogIn/Layout_Before_LogIn';


function App() {
    return (
        <Routes>
            <Route
                path="/"
                element={
                    <LayoutBeforeLogIn>
                        <Route index element={<Home />} />
                        <Route path="contact" element={<Contact />} />
                        <Route path="medics/*" element={<AllMedics />} />
                        <Route path="services/*" element={<AllServices />} />
                        <Route path="opening-hours" element={<OpeningHours />} />
                    </LayoutBeforeLogIn>
                }
            />
            <Route path="log-in" element={<LogIn />} />
        </Routes>
    );
}


export default App;
